import { RECEIVE_API_DATA } from "./asset.actions";

// eslint-disable-next-line import/no-anonymous-default-export
export default (state = {}, { type, data }) => {
  switch (type) {
    case RECEIVE_API_DATA:
      return data;
    default:
      return state;
  }
};
